  false,\n\t\"url\": null,\n\t\"notes\": \"EPA's Web Taxonomy is a faceted hierarchical
  vocabulary used to tag web pages with terms from a controlled vocabulary. Tagging
  enables search and discovery of EPA's Web based information assests. EPA's Web Taxonomy
